import React from "react";

const Cat = ({category,categoryList}) => {
  return (
    <div
      style={{
        width: "auto",
        marginRight: "20px",
        marginBottom: "10px",
      }}
    >
      <a href={`/products?cat=${category.categoryId}`}>
        {" "}
        <article
          style={{
            cursor: "pointer",
            color: category.categoryId === categoryList ? "crimson" : "black",
            textDecoration:
              category.categoryId === categoryList ? "underline" : "none",
          }}
        >
          {category.categoryName}
        </article>
      </a>
    </div>
  );
};

export default Cat;
